 <h1 class=headline><font style=vertical-align:inherit><font style=vertical-align:inherit>Directories abroad&amp;nbsp;</font></font></h1>
 <p class=bodytext><font style=vertical-align:inherit><font style=vertical-align:inherit>It often happens that there is a need for foreign information services. </font><font style=vertical-align:inherit>You may need to call a restaurant, taxi or hotel. </font><font style=vertical-align:inherit>We have made an overview of telephone numbers and telephone directories abroad. </font><font style=vertical-align:inherit>Most players offer searches for people, addresses, telephone numbers, fax numbers and companies abroad. </font><font style=vertical-align:inherit>Applications can usually be limited to state, city, town or postcode.&amp;nbsp;</font></font></p>
